var chromenow = (function (module) {
	//Create a card constructor
	var google = function(cardId){this.setCardId(cardId);};
	google.prototype = new module.Card("google", chrome.runtime.id);
	google.prototype.name = "Google";
	google.prototype.author = "Matthew Morrow";
	google.prototype.description = "The current Google sevices";
	
	var imageUrl = "data:image/png;base64,";
	var services = [
		{name:"Google+", url:"https://plus.google.com/u/0/", backgroundPosition:"-408px -69px"},
		{name:"Search", url:"https://www.google.com/webhp", backgroundPosition:"-138px 0"},
		{name:"Youtube", url:"https://www.youtube.com/", backgroundPosition:"0 -69px"},
		{name:"Maps", url:"https://maps.google.com/maps?hl=en", backgroundPosition:"-117px -138px"},
		{name:"Play", url:"https://play.google.com/", backgroundPosition:"-69px -69px"},
		{name:"News", url:"https://news.google.com/nwshp", backgroundPosition:"-138px -368px"},
		{name:"Gmail", url:"https://mail.google.com/mail/", backgroundPosition:"-69px -368px"},
		{name:"Drive", url:"https://drive.google.com/", backgroundPosition:"-408px 0"},
		{name:"Google Calendar", url:"https://www.google.com/calendar", backgroundPosition:"-186px -138px"},
	];
	
	google.prototype.create = function(){
		var card = this;
		card.style.html("");
		card.style.append(".google {display:block; width:20%; float:left; padding:5px; box-sizing:border-box; text-align:center;overflow:hidden;}");
		card.style.append(".google-img {width:64px; height:64px; display:block;margin:auto;}");
		card.style.append(".google-img {background-image:url("+imageUrl+")}");
		card.style.append(".google-name {width:100%;marign:auto;font-size:0.8rem;text-overflow:ellipsis;display:block;white-space:nowrap;overflow:hidden;}");
		
		card.front.html("");
		for(var i = 0; i < services.length; ++i){
			var appIcon = $("<a class=\"google\"></a>");
			appIcon.attr("href", services[i].url);
			appIcon.append($("<span class=\"google-img\" />").css("background-position", services[i].backgroundPosition));
			appIcon.append($("<span class=\"google-name\">"+services[i].name+"</span>"));
			card.front.append(appIcon);
		};
		card.front.append($("<div style=\"clear:both;\"></div>"));
	};

	//Record the cards and register this extension
	module.baseExtension.cardTypes["google"] = google;
	
	return module;
}(chromenow ));